import { NavLink } from 'react-router-dom';
import s from './Header.module.css';

const Header = () => {
    return ( 
        <>
            <h1 className={s.h1}>UsiChat</h1>
            <div className={s.loginBlock}>
                <NavLink to="">Login</NavLink>
            </div>
        </>
    )
}
export default Header;
